import React from 'react';
import './App.css';
import { AppBar, Toolbar, Container, IconButton, Typography } from '@material-ui/core'
import {} from '@material-ui/icons'

function App() {
  return (
    <AppBar position="fixed">
      <Container fixed>
        <Toolbar>
          <IconButton
            color='inherit'
            aria-label='menu'
          >
          </IconButton>
          <Typography>
            Web Developer Blog
          </Typography>
        </Toolbar>
      </Container>

    </AppBar>  
  );
}

export default App;
